import { Avatar } from '@material-ui/core';
import React from 'react'
import "./Chat.css";

function Chat() {
    return (
        <div className="chat">
            <div className="chat__header">
                <Avatar/>
                <div classname='chat__headerInfo'>
                    <h3>Room name</h3>
                    <p>last seen </p>
                </div>
              <div className="chat_headerRight"></div>
            </div>
        </div>
    )
}

export default Chat
